public boolean equals(Object o) {
    Cluster c = (Cluster) o;
    if (this.artifacts.size() == c.artifacts.size()) {
        int counter = 0;
        for (IArtifact artifact : c.artifacts) {
            if (this.artifacts.contains(artifact)) {
                counter++;
            }
        }
        if (counter == this.artifacts.size()) {
            return true;
        } else {
            return false;
        }
    } else {
        return false;
    }
}
